import React from 'react'

const Home = ({origin, setOrigin, destination, setDestination, getFlightEmissions, emissions, SearchForm, FlightSearchResult, searchSuccessful, addSearchedFlight, FlightList, addFlight, userFlights, removeFlight}) => {

return (
    <>
<div>
<h2>Main Container</h2>
<SearchForm
    origin={origin}
    setOrigin={setOrigin}
    destination={destination}
    setDestination={setDestination}
    getFlightEmissions={getFlightEmissions}
    emissions={emissions}
/>
<FlightSearchResult
    origin={origin}
    destination={destination}
    emissions={emissions}
    searchSuccessful={searchSuccessful}
    addSearchedFlight={addSearchedFlight}
/>

<FlightList
    addFlight={addFlight}
    userFlights={userFlights}
    removeFlight={removeFlight}
/>

</div> 
</>

)
}

export default Home
